ecerá em um lugar e aparecerá na navegação do seu site na maioria dos temas. Muitas pessoas começam com uma página que as apresenta a possíveis visitantes do site. Ela pode dizer algo assim:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>Olá! Eu sou um mensageiro de bicicleta durante o dia, ator aspirante à noite, e este é o meu site. Eu moro em São Paulo, tenho um grande cachorro chamado Rex e gosto de tomar caipirinha (e banhos de chuva).</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>...ou alguma coisa assim:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>A Companhia de Miniaturas XYZ foi fundada em 1971, e desde então tem fornecido miniaturas de qualidade ao público. Localizada na cidade de Itu, a XYZ emprega mais de 2.000 pessoas e faz coisas grandiosas para a comunidade da cidade.</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>Como um novo usuário do WordPress, você deveria ir ao <a href=\"http://localhost/fidelidade/wp-admin/\">painel</a> para excluir essa página e criar novas páginas para o seu conteúdo. Divirta-se!</p>\n<!-- /wp:paragraph -->','Página de exemplo','','inherit','closed','closed','','2-revision-v1','','','2021-09-19 22:47:01','2021-09-20 01:47:01','',2,'http://restaurantemegachic.com/fidelidade/2-revision-v1/',0,'revision','',0),(72,1,'2021-09-20 22:42:49','0000-00-00 00:00:00','','Rascunho automático','','auto-draft','closed','closed','','','','','2021-09-20 22:42:49','0000-00-00 00:00:00','',0,'http://restaurantemegachic.com/fidelidade/?page_id=72',0,'page','',0),(73,1,'2021-09-20 22:51:12','2021-09-21 01:51:12','','Painel Empresa  - minha empresa - alterar senha','','publish','closed','closed','','minha-empresa-alterar-senha','','','2021-09-29 17:55:12','2021-09-29 20:55:12','',0,'http://restaurantemegachic.com/fidelidade/?page_id=73',0,'page','',0),(74,1,'2021-09-20 22:51:12','2021-09-21 01:51:12','','minha empresa al